        body {
            margin: 0;
            padding: 0;
            font-family: 'PP Neue Montreal', sans-serif;
            background: #0C0F1D;
            color: #f7f7f7;
        }

        .container {
            min-height: 100vh;
            background: linear-gradient(180deg, #0C0F1D 0%, #7ca19c 100%);
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 2rem;
        }

        .content-box {
            background: #0C0F1D;
            border: 2px solid #7ca19c;
            border-radius: 24px;
            padding: 2rem;
            width: 90%;
            max-width: 1200px;
            min-height: 85vh;
            display: flex;
            justify-content: center;
            align-items: center;
            position: relative;
            overflow: hidden;
        }

        .content {
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 2rem;
            text-align: center;
            z-index: 1;
        }

        .walrus-logo {
            width: clamp(158px, 15vw, 187px);
            height: auto;
        }

        .title {
            font-family: 'PP Neue Bit', sans-serif;
            font-size: clamp(25px, 5vw, 68px);
            max-width: 600px;
            font-weight: bold;
        }

        .subtitle {
            font-family: 'PP Neue Bit', sans-serif;
            font-size: clamp(25px, 4vw, 42px);
            max-width: 600px;
            font-weight: bold;
            line-height: 1.4;
        }

        .button {
            background: #7ca19c;
            color: #0C0F1D;
            padding: 1rem 2rem;
            border: none;
            border-radius: 12px;
            font-size: 16px;
            cursor: pointer;
            text-decoration: none;
            transition: all 0.3s ease;
            min-height: 48px;
            display: flex;
            align-items: center;
            font-family: 'PP Neue Montreal', sans-serif;
        }

        .button:hover {
            background: #0C0F1D;
            color: #7ca19c;
            border: 1px solid #7ca19c;
        }

        .globe {
            position: absolute;
            bottom: -20%;
            width: 100%;
            max-width: 1200px;
            opacity: 0.75;
            pointer-events: none;
        }

        @media (max-width: 768px) {
            .content-box {
                padding: 1rem;
                min-height: 95vh;
            }
        }
    </style>
</head>
